import React from 'react';
import Typewriter from "typewriter-effect";

export class LandingPage extends React.Component {

    render() {
        return(
            <>

                <div className='mt-32 flex items-center justify-center'>

                    <div className='h-64 w-80 rounded-xl bg-violet-300 flex items-center justify-center shadow-2xl'>
                        <div className='flex-col items-center justify-center'>
                            <img alt="beer guy" src={require('../img/beerguy.png')} className='w-40'/>
                            <h1 className='text-4xl pl-8'>
                                <Typewriter 
                                    options = {{
                                        strings: ["Skål!", "Prost!", "Salut!", "Cheers!", "Zdrowie!"],
                                        autoStart: true,
                                        loop: true,
                                        cursor: "_"
                                    }}
                                />
                            </h1>
                        </div>
                    </div>
                </div>

                <div className='flex items-center justify-center'>

                    <div className='flex items-center justify-center h-32 w-32 rounded-xl bg-violet-400 m-3 mt-20 shadow-md'>

                        <div className='flex-col'>

                            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className="w-6 h-6">
                                <path strokeLinecap="round" strokeLinejoin="round" d="M12 21v-8.25M15.75 21v-8.25M8.25 21v-8.25M3 9l9-6 9 6m-1.5 12V10.332A48.36 48.36 0 0012 9.75c-2.551 0-5.056.2-7.5.582V21M3 21h18M12 6.75h.008v.008H12V6.75z" />
                            </svg>
                            <p>Host</p>

                        </div>

                    </div>

                    <div className="flex-col h-32 w-32 rounded-xl bg-violet-400 m-3 mt-20 shadow-md">

                    </div>

                </div>

            </>
        );
    }
}
